import { useState } from 'react';

function ImagePlaceholder(){
  return (<div class="greenBackground" style={{height: "50px"}}></div>);
}

function TopMenu(){
  return (
      <ul class="greenBackground">
        <li><a href="#forside">Forside</a></li>
        <li><a href="#zoneterapi">Zoneterapi</a></li>
        <li><a href="#healing">Healing</a></li>
        <li><a href="#reaktion">Reaktion p√• behandling</a></li>
        <li><a href="#kontakt">Kontakt</a></li>
        <li><a href="#earfaringer">Erfaringer</a></li>
        <li><a href="#priser">Priser</a></li>
        <li><a href="#booking">Online booking</a></li>
      </ul>
  );
}

function Temp(){
  return <div style={{width: "70vw", margin: "auto"}}>
    <ImagePlaceholder/>
    <TopMenu/>
    </div>
}

export default function App() {
  return <Temp />;
}
